#include "./../../main_test.h"

static void s21_test_from_float_to_decimal(float value, s21_decimal result,
                                           int code, char *text, int count);

//############################# EDGE CASE #####################################
START_TEST(s21_from_float_to_decimal_edge_1) {
  float value_1 = 0.0;
  s21_decimal *value_2 = NULL;
  int code = 1;
  int my_code = s21_from_float_to_decimal(value_1, value_2);
  ck_assert_int_eq(code, my_code);
}

START_TEST(s21_from_float_to_decimal_edge_2) {
  float value_1 = 0.0 / 0.0;
  s21_decimal value_2 = {{0}};
  int code = 1;
  int my_code = s21_from_float_to_decimal(value_1, &value_2);
  ck_assert_int_eq(code, my_code);
}

